import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Home from './Home';
import throttleAdapterEnhancer from 'axios-throttle';

// Create an instance of Axios with throttling
const axiosThrottled = axios.create();
axiosThrottled.defaults.adapter = throttleAdapterEnhancer(axios.defaults.adapter, {
  // Configure your desired request rate limit here
  threshold: 2000, // 2 seconds
});

const NewsItem = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const getData = async () => {
      try {
        const response = await axiosThrottled.get('https://newsapi.org/v2/everything?q=tesla&from=2023-08-14&sortBy=publishedAt&apiKey=a612a032fc214df2962a6fcd6d4fe944');
        setData(response.data.articles);
        console.log(response.data.articles);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };
    getData();
  }, []);

  return (
    <div>
      {/* Pass the 'data' array as a prop to the 'Home' component */}
    </div>
  );
};

export default NewsItem;
